import React from 'react';
import './Register.css'
import img from './samples/register.png'
const Register = ()=> {
return(

    <>
     <div className="body"> 
     <div className="content">


    
   

     <img src={img} alt="CAR"></img>
      
     <div className="reg-number-plate">


     </div>
     </div>
     </div>

    </>
)


}
export default Register;
